import React, { useState } from 'react'

export const DMWindow = () => {
    const [messageList, setMessafeList] = useState([{text: 'pepa', id: 0}, {text: 'pepo', id: 1}]);
    const messages = messageList.map((message) =>
    <li key={message.id}><p>{message.text}</p></li>
);
  return (
    <div className='DMWindow'>
        <div className='DMList'>
            <ul>{messages}</ul>
        </div>
    </div>
  )
}
